import React from "react";
import { withStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import { CardActions, CardHeader } from "@material-ui/core";
import Divider from "@material-ui/core/Divider";
import Grid from "@material-ui/core/Grid";
import axios from "axios";
const styles = theme => ({
  label: {
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "20px",
    margin: theme.spacing.unit * 2,
    color: "#1C80B5",
    width: 800
  },
  textField: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: 1200,
    height: 75
  },
  nextButton: {
    backgroundColor: "#1C80B5"
  },
  card: {
    height: 400
  }
});
class EdiParent extends React.Component {
  state = {
    values: [],
    name: [],
    StateName: "",
    tpaId: "",
    inputJsonOnExchange: [
      { id: 1, StateId: "ca", StateName: "CALIFORNIA", tpaId: "" },
      { id: 2, StateId: "tx", StateName: "TEXAS", tpaId: "" }
    ],
    inputJsonOfExchange: [
      { id: 3, StateId: "ca", StateName: "california", tpaId: "" },
      { id: 4, StateId: "tx", StateName: "texas", tpaId: "" }
    ],
    panel: []
  };

  constructor(props) {
    super(props);
  }

  handleChange = tpaId => event => {
    const { StateName, tpaId } = this.state;
    tpaId: event.target.value;
    this.setState({ tpaId });
    // var temp = this.state.inputJsonOnExchange;
