                <TextField
                  disabled
                  key={card.id}
                  id="standard-disabled"
                  variant="standard"
                  className={classes.textField}
                  value={card.StateName}
                  margin="normal"
                />
                <TextField
                  required
                  fullWidth
                  id="standard-full-width"
                  variant="standard"
                  className={classes.textField}
                  label="TPA ID"
                  value={card.tpaId}
                  onChange={this.handleChange(card.tpaId)}
                  margin="normal"
                />
              </div>
            ))}
          </CardContent>
          <Grid
            container
            alignItems="flex-start"
            justify="flex-end"
            direction="row"
          >
            <CardContent>
              <Button
                type="submit"
                className={classes.nextButton}
                onClick={this.handleSubmit}
              >
                Next
              </Button>
            </CardContent>
          </Grid>
        </Card> */}
      </Grid>
    );
  }
}

export default withStyles(styles)(EdiParent);
